import React from "react";
import "../styles/Form.css";

const Form = () => {
  return (
    <div className="Form">
      <div className="Form_left">
        <p className="Form_title">Email Newsletter</p>
        <p className="Form_Main">
          Subscribe <br />
          for updates
        </p>
      </div>
      <div className="Form_right"></div>
    </div>
  );
};

export default Form;
